  false,\n\t\"url\": null,\n\t\"notes\": \"Georeferenced image, acquired on August
  27, 1965 over a portion of the Ouray National Wildlife Refuge. Image covers the
  northern portion of the refuge including Leota and Johnson Bottoms. This data set
  is a georeferenced version of an original black and white aerial photograph downloaded
  from Earth Explorer (USGS; www.earthexplorer.usgs.gov). The original photo (Frame
  131) was georeferenced against the 2009 NAIP image within ArcMap 10.1. Six to eight
  points were used in the georeferencing process. This data set provides a look back
  in time following the closure of the Flaming Gorge Dam. It allows a look at landscape
  features including riparian vegetation extent, existing farmland, shrublands, etc.
  It also provides an important look at the location of the Green River channel to
  interpret river dynamics and movement. The image covers most of Leota Bottom and
  all of Johnson Bottom. This image provides a snapshot soon after construction began
  on the wetland impoundments within Leota Bottom. Pixel resolution of this image
  is 0.6 meters. This image should be used for resource level interpretation only.\",\n\t\"license_title\":
